(35, 169362578, '2017-03-29', '22:01:12', NULL, '22:02:56', '32491232786', '32493161454', 'Relevant', 'Out', NULL, 'NESPOLA ressone pour avoir 1 demi , il demande pour que chacun fasse la moitié du chemin, GELLEE Ludovic ne veut pas. ', 'Voice', 1, 7),
(36, 169369997, '2017-03-30', '10:10:33', NULL, '10:12:29', '32491232786', '32493161454', 'Relevant', 'Out', NULL, 'NESPOLA recontacte pour voir si il a vu son contact. Ludovic dit que non. NESPOLA dit que ce serait bien de voir le gars car le petit bloc fait 25 grammes  Ludovic précise que ça le fait chier de pas pouvoir servir pour le moment mais qu\'il va faire venir un gars et que si le gars accepte, NESPOLA va pleurer de joie. Ludovic précise aussi que des gens lui doivent de l\'argent mais que personne ne répond.', 'Voice', 1, 7),
(37, 169371390, '2017-03-30', '11:14:50', NULL, '11:17:03', '32491232786', '32493161454', 'Relevant', 'Out', NULL, 'NESPOLA contacte Ludovic, Ludovic dit que son contact va venir et que NESPOLA va pleurer. Ludovic dit qu\'il va mettre NESPOLA à Genoux, (NESPOLA rigole). NESPOLA dit qu\'il a récupéré une montre GUCCI. Ludovic lui dit de mettre cela de côté car il va la prendre et qu\'ils s\'arrangeront après.', 'Voice', 1, 7),
(38, 169372996, '2017-03-30', '12:15:11', NULL, '12:15:58', '32491232786', '32493161454', 'Relevant', 'Out', NULL, 'NESPOLA appele Ludovic, Ludo lui demande de le recontacter parcequ\'il vient de se prendre une boite, il vient de peser et c\'est du 8.9. Ludovic vient de recontacter le gars pour qu\'il revienne.', 'Voice', 1, 7),
(39, 169375610, '2017-03-30', '13:31:22', NULL, '13:32:20', '32491232786', '32493161454', 'Relevant', 'Out', NULL, 'Ludovic dit qu\'il vient de se faire enculer. (concernant sa livraison), NESPOLA demande si il a toujours ses trucs. Ludovic est nerveux. Il dit qu\'il le tient au courant.', 'Voice', 1, 7),
(40, 169379208, '2017-03-30', '15:18:23', NULL, '15:31:48', '3243530492', '32491232786', 'Relevant', 'In', NULL, 'GOFFIN Alain contacte NESPOLA avec le numéro de Fix, il demande si ils travaillent le lendemain, NESPOLA lui dit qu\'il ne s\'est pas levé à cause de son fils qui a coupé le réveil. GOFFIN Alain, lui parle d\'achat de "Beuh" fait avec les contributions qu\'il vient de recevoir.... Ensuite NESPOLA parle de Ludovic, il dit à GOFFIN que Ludovic a quelques trucs à lui et qu\'il voudrait bien en avoir la couleur. NESPOLA explique qu\'un "Toxicomane" lui a échangé des bijoux en or contre des cigarettes. NESPOLA précise qu\'il a été vendre quelques trucs en or (Le Toxicomane serait un prénommé Eric). NESPOLA aurait amené 6 grammes d\'or à un endroit pour le vendre et il aurait reçu 105 euros. NESPOLA précise que Ludovic a un bloc de 25 grammes lui appertenant. Ce bloc serait un tout petit Lingot d\'or, il a peur d\'aller le vendre à une bijouterie car il va se faire prendre par la police et aller en Prison donc il l\'a laissé chez Ludovic.La suite de la conversation parle de travail. Il parle de rachat de consol WII Nintendo pour 150 euros à Ludovic. (GOFFIN Alain et NESPOLA Gaetano travaille en noir car GOFFIN précise qu\'il n\'a pas de travail officiel)', 'Voice', 1, 7),
