(68, 169391800, '2017-03-30', '21:53:32', NULL, '21:55:33', '3243530492', '32493161454', 'Relevant', 'In', NULL, 'GELLEE Ludovic explique qu\'il va aller à la Bijouterie avec un pote pour faire évaluer le bloc d\'or. Ensuite GELLEE Ludovic dit qu\'il a des trucs chez lui qui vont plaire à sa femme si il veut lui faire un cadeau ', 'Voice', 1, 7),
(69, 169392012, '2017-03-30', '22:03:48', NULL, '22:14:55', '32496867631', '32493161454', 'Relevant', 'In', NULL, 'Son interlocuteur lui explique que le lendemain sa mère va venir chercher le bloc d\'or ainsi que la chaine, elle connait des gens qui travaillent chez Paul FAGO à la bijouterie du Pairay, ils vont la tester avec de l\'acide.Il lui indique que si c\'est bon, il reviendra avec l\'argent ou si ce n\'est pas bon, il reviendra avec le bloc d\'or. Il lui demande d\'attendre sa mère au Pairay, lui donner l\'or et attendre une heure. Il lui indique par contre que si il veut en tirer un bon prix, il faut aller à Anvers. Finalement il lui indique qu\'il ne pourra certainemnet qu\'en tirer 600 euros. GELLE Ludovic est déçu car une autre personne lui en propose beaucoup plus. GELLE Ludovic lui indique que si il arrive à la vendre à un bon prix, il lui donne la chaine en or en cadeau plus 200 euros ou 300 euros.', 'Voice', 1, 7),
(70, 169392592, '2017-03-30', '22:38:59', NULL, '22:41:04', '32493161454', '32493162977', 'Relevant', 'Out', NULL, 'L\'interlocuteur lui demande de lui préparer un bon 10 ou un bon G. ils parlent ensuite de la qualités. GELLE Ludovic lui indique que c\'est de la bonne maintenant. L\'interlocuteur lui demande si il n\'a pas égalemnet des préservatifs ce que GELLE Ludovic répond par la négative.', 'Voice', 1, 7),
