(164, 169369997, '2017-03-30', '10:10:33', NULL, '10:12:29', '32491232786', '32493161454', 'Relevant', 'Out', NULL, 'NESPOLA recontacte pour voir si il a vu son contact. Ludovic dit que non. NESPOLA dit que ce serait bien de voir le gars car le petit bloc fait 25 grammes  Ludovic précise que ça le fait chier de pas pouvoir servir pour le moment mais qu\'il va faire venir un gars et que si le gars accepte, NESPOLA va pleurer de joie. Ludovic précise aussi que des gens lui doivent de l\'argent mais que personne ne répond.', 'Voice', 2, 9),
