(167, 169375610, '2017-03-30', '13:31:22', NULL, '13:32:20', '32491232786', '32493161454', 'Relevant', 'Out', NULL, 'Ludovic dit qu\'il vient de se faire enculer. (concernant sa livraison), NESPOLA demande si il a toujours ses trucs. Ludovic est nerveux. Il dit qu\'il le tient au courant.', 'Voice', 2, 9),
(168, 169379208, '2017-03-30', '15:18:23', NULL, '15:31:48', '3243530492', '32491232786', 'Relevant', 'In', NULL, 'GOFFIN Alain contacte NESPOLA avec le numéro de Fix, il demande si ils travaillent le lendemain, NESPOLA lui dit qu\'il ne s\'est pas levé à cause de son fils qui a coupé le réveil. GOFFIN Alain, lui parle d\'achat de "Beuh" fait avec les contributions qu\'il vient de recevoir.... Ensuite NESPOLA parle de Ludovic, il dit à GOFFIN que Ludovic a quelques trucs à lui et qu\'il voudrait bien en avoir la couleur. NESPOLA explique qu\'un "Toxicomane" lui a échangé des bijoux en or contre des cigarettes. NESPOLA précise qu\'il a été vendre quelques trucs en or (Le Toxicomane serait un prénommé Eric). NESPOLA aurait amené 6 grammes d\'or à un endroit pour le vendre et il aurait reçu 105 euros. NESPOLA précise que Ludovic a un bloc de 25 grammes lui appertenant. Ce bloc serait un tout petit Lingot d\'or, il a peur d\'aller le vendre à une bijouterie car il va se faire prendre par la police et aller en Prison donc il l\'a laissé chez Ludovic.La suite de la conversation parle de travail. Il parle de rachat de consol WII Nintendo pour 150 euros à Ludovic. (GOFFIN Alain et NESPOLA Gaetano travaille en noir car GOFFIN précise qu\'il n\'a pas de travail officiel)', 'Voice', 2, 9),
