(188, 169387004, '2017-03-30', '19:13:02', NULL, '19:14:26', '3243530492', '493161454', 'Relevant', 'In', NULL, 'Dans un sms précédent, GELLEE Ludovic demande à GOFFIN de lui sonner. GOFFIN lui sonne et GELLEE Ludovic lui propose d\'écouler 25 gellules pour 90 euros, GELLE Ludovic lui indique qu\'il ne pourra pas l\'écoulé car c\'est de la "cultis".  GOFFIN lui dit que ce ne l\'intéresse pas.', 'Voice', 2, 9),
