(190, 169387722, '2017-03-30', '19:35:33', NULL, '19:36:08', '32496867631', '32493161454', 'Relevant', 'In', NULL, 'Un indiviud demande si il peut passer chez GELLE Ludovic, il lui dit que c\'est pour comme hier', 'Voice', 2, 9),
(191, 169389160, '2017-03-30', '20:20:39', NULL, '20:20:59', '32493161454', '32491125731', 'Relevant', 'Out', NULL, 'GELLEE Ludovic contacte une personne qui pourrait être son fournisseur puisqu\'il lui demande si il peut passer. ', 'Voice', 2, 9),
(192, 169389290, '2017-03-30', '20:24:42', NULL, '20:24:52', '32493161454', '32491125731', 'Relevant', 'Out', NULL, 'GELLE Ludovic vient d\'arriver devant son potentiel fournisseur (Pylone accroché : Place des Tourterelles 1 à 4100 Seraing)', 'Voice', 2, 9),
(193, 169390626, '2017-03-30', '21:11:45', NULL, '21:12:38', '32496867631', '32493161454', 'Relevant', 'In', NULL, 'Un individu lui sonne et lui indique que le lendemain après le travail, il viendra prendre le truc pour le tester au Pairay (il est prèt à payer 1000 euros)', 'Voice', 2, 9),
(194, 169390788, '2017-03-30', '21:18:20', NULL, '21:20:17', '32493161454', '32493162977', 'Relevant', 'Out', NULL, 'Discussion concernant un travail a faire chez l\'intéressé, histoire de carrelage à placer. Ensuite l\'interlocuteur demande si GELLEE Ludovic peut passer.', 'Voice', 2, 9),
(195, 169391098, '2017-03-30', '21:32:29', NULL, '21:33:28', '32493161454', '32493162977', 'Relevant', 'Out', NULL, NULL, 'Voice', 2, 9),
(196, 169391800, '2017-03-30', '21:53:32', NULL, '21:55:33', '3243530492', '32493161454', 'Relevant', 'In', NULL, 'GELLEE Ludovic explique qu\'il va aller à la Bijouterie avec un pote pour faire évaluer le bloc d\'or. Ensuite GELLEE Ludovic dit qu\'il a des trucs chez lui qui vont plaire à sa femme si il veut lui faire un cadeau ', 'Voice', 2, 9),
(197, 169392012, '2017-03-30', '22:03:48', NULL, '22:14:55', '32496867631', '32493161454', 'Relevant', 'In', NULL, 'Son interlocuteur lui explique que le lendemain sa mère va venir chercher le bloc d\'or ainsi que la chaine, elle connait des gens qui travaillent chez Paul FAGO à la bijouterie du Pairay, ils vont la tester avec de l\'acide.Il lui indique que si c\'est bon, il reviendra avec l\'argent ou si ce n\'est pas bon, il reviendra avec le bloc d\'or. Il lui demande d\'attendre sa mère au Pairay, lui donner l\'or et attendre une heure. Il lui indique par contre que si il veut en tirer un bon prix, il faut aller à Anvers. Finalement il lui indique qu\'il ne pourra certainemnet qu\'en tirer 600 euros. GELLE Ludovic est déçu car une autre personne lui en propose beaucoup plus. GELLE Ludovic lui indique que si il arrive à la vendre à un bon prix, il lui donne la chaine en or en cadeau plus 200 euros ou 300 euros.', 'Voice', 2, 9),
(198, 169392592, '2017-03-30', '22:38:59', NULL, '22:41:04', '32493161454', '32493162977', 'Relevant', 'Out', NULL, 'L\'interlocuteur lui demande de lui préparer un bon 10 ou un bon G. ils parlent ensuite de la qualités. GELLE Ludovic lui indique que c\'est de la bonne maintenant. L\'interlocuteur lui demande si il n\'a pas égalemnet des préservatifs ce que GELLE Ludovic répond par la négative.', 'Voice', 2, 9),
(199, 169393812, '2017-03-30', '23:21:28', NULL, '23:21:44', '32494871357', '0493161454', 'Relevant', 'In', NULL, 'L\'interlocuteur demande si GELLE Ludovic est rentré, il lui dit qu\'il arrive qu\'il est au niveau de la pompe.', 'Voice', 2, 9),
(200, 169393844, '2017-03-30', '23:23:13', NULL, '23:23:13', '32493161454', '32496867631', 'Relevant', 'Out', 'Gros vraiment désolé le lingot est vendu mais la chaîne je t en fai', NULL, 'SMS', 2, 9),
(201, 169393845, '2017-03-30', '23:23:13', NULL, '23:23:13', '32493161454', '32496867631', 'Relevant', 'Out', 's cadeau ??', NULL, 'SMS', 2, 9),
(202, 169393846, '2017-03-30', '23:23:15', NULL, '23:23:15', '32496867631', '32493161454', 'Relevant', 'In', NULL, NULL, 'SMS', 2, 9),
(203, 169393916, '2017-03-30', '23:28:54', NULL, '23:30:49', '32493161454', '32478110916', 'Relevant', 'Out', NULL, 'GELLE Ludovic contacte une personne pour lui indiquer que le lingot d\'or va être vendu, il voulait l\'en tenir informé. l\'interlocuteur semble content. L\'interlocuteur en profite pour demander à Ludovic si il peut passer maintenant. Ludovic accepte.', 'Voice', 2, 9),
